"""
Q152
Maximum Product Subarray
Medium

Given an integer array nums, find the contiguous
subarray within an array (containing at least one
number) which has the largest product.
"""

from typing import List


class Solution:
    def maxProduct(self, nums: List[int]) -> int:

        max_val = float("-inf")

        n = len(nums)
        print(n)

        if n == 0:
            return 0

        if n == 1:
            return nums[0]

        nums_new = [nums[0], nums[1]]

        for i in range(2, n):
            if nums[i] == 1 and nums_new[-1] == 1:
                continue
            elif nums[i] == 1 and nums_new[-1] == -1:
                continue
            #elif nums[i] == -1 and nums_new[-1] == 1:
            #    nums_new[-1] = -1
            elif nums[i] == -1 and nums_new[-1] == -1 and nums_new[-2] == -1:
                nums_new.pop()
            else:
                nums_new.append(nums[i])

        nums = nums_new
        n = len(nums)

        print(n)

        if n == 0:
            return 0

        if n == 1:
            return nums[0]

        res = {}

        for i in range(0, n):
            res[i, i] = nums[i]
            if nums[i] > max_val:
                max_val = nums[i]

        for length in range(2, n):
            for start in range(0, n-length+1):
                prod = nums[start] * res[start+1, start+length-1]
                res[start, start+length-1] = prod
                if prod > max_val:
                    max_val = prod

        if nums[0] * res[1, n-1] > max_val:
            return nums[0] * res[1, n-1]
        else:
            return max_val


